measurements.description:
Thirteen slightly cupped flowers on one arching 53-cm inflorescence;

	dorsal sepal pale yellow, midrib finely spotted light burgundy; 
	lateral sepals pale yellow, veins lightly spotted burgundy;
	petals pale yellow, midrib finely spotted light burgundy;

	lip white, sidelobes burgundy at margins, midlobe randomly marked large oxblood spots, centrally dark burgundy stripe, keels yellow; 
	column light magenta, anther cap white;
	 substance firm; texture matte.
